script: |
  super -f text -I q9710.spq | sort > q9710.out

inputs:
  - name: q9710.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) cor0 WHERE - 82 * - + 11 NOT BETWEEN ( + + 96 ) AND col2 + + + ( - col0 ) * - + col1;
  - name: tab0

outputs:
  - name: q9710.out
    data: |
      97	1	99
